import React from 'react';
import Menu from './modules/Menu'
import Mymap from './modules/Mymap'

class App extends React.Component {

  constructor(props) {
    super()
    this.state = {
        position: [0, 0],
        zoom: 16,
        mapBounds: [[0, 600], [450, 0]], 
        imageUrl: require("./img/firstFloor.jpg"),
        imageBounds: [[450, 0], [0, 600]]
    }
  }

  render() {
    return (
      <div className="App">
        <Menu />
        <Mymap mapBounds={this.state.mapBounds} imageUrl={this.state.imageUrl} imageBounds={this.state.imageBounds}/>
      </div>
    );
  }
}

export default App;
